import React, { useState } from 'react';

const Home = () => {

  const [isLoading, setIsLoading] = useState(false);

  if (isLoading) return <div>Loading...</div>;
  return (
    <div>
     <title>
       <h1>Explore</h1>
       <h1>Mars</h1>
     </title>
    </div>
  );
};

export default Home;
